import React from 'react';
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';
class Footer extends  React.Component{
    render(){
        return(
            <div>
                <img src="img1_logo.jpg" width="70px"/>
            <h4>
                <Link  id="aboutId" to='/products'>ABOUT SB</Link>
            </h4>
            <h4>
                <Link id="careerId" to='/applications'>CAREERS</Link>
            </h4>
            <h4>
                <Link id="investId" to='/design'>INVESTORS</Link>
            </h4>
            <h4>
                <Link id="mediaId" to='/support'>MEDIA</Link>
            </h4>
            <h4>
                <Link id="contactId" to='/company'>CONTACT</Link>    
            </h4>
            <h3>
                <Link id="subscribeId" to='/signinform'>SUBSCRIBE</Link>                
            </h3>
            </div>
        );
    }
}
export default Footer;
